import React from "react";
import Heading from "./Heading";
import Car from "./Car";
import carList from "./CarDictionary";

function carMapping(names){
    return <Car 
        key={names.id}
        car={names.name}
    />;
}

var button = document.getElementsByClassName("add");

function List(){
    return <div>
        <Heading />
        <ul>
            {carList.map(carMapping)}
        </ul>
        <button className="add" type="submit">Submit</button>
    </div>;
}

export default List;
